import axios from "axios";
import { useEffect, useRef } from "react"

export default function TargetWeight()
{
    const userId = localStorage.getItem('userId');
    const targetRef = useRef(null);

    function target_change()
    {    
        const fetchData = async () =>{
            try{

                const targetInput = await axios.post('http://localhost:4000/api/target_weight',{
                    id:userId,
                    target_weight:targetRef.current.value
                });
            }catch(err){
                console.err('에러:',err);
            }
        }
        fetchData();
    };

    return (
        <div>
            <form onSubmit={target_change}>
                <input type="number" placeholder="목표체중" ref={targetRef}/>
                <button>저장</button>
            </form>
        </div>
    )
}
